demo.repl.help:
Perintah yang tersedia:
  @show              ─ tampilkan ringkasan kartu adaptif terakhir
  @json              ─ keluarkan nilai JSON mentah yang diterima dari alur
  @back              ─ kembalikan ke kartu/input yang diblokir sebelumnya
  @input <k>=<v>     ─ tetapkan atau timpa field input
  @click <action_id> ─ kirim kartu dengan aksi yang diberikan
  @help              ─ cetak teks bantuan ini
  @quit              ─ keluar dari REPL
